                offset: offset,
                recordTypeConverter: recordTypeConverter,
                fill: ret.FillRecordType);
            return ret;
        }

        public TryGet<int?> FillRecordType(
            BinaryMemoryReadStream stream,
            long finalPos,
            int offset,
            RecordType type,
            int? lastParsed,
            RecordTypeConverter recordTypeConverter)
        {
            type = recordTypeConverter.ConvertToStandard(type);
            switch (type.TypeInt)
            {
                case 0x52444548: // HEDR
                {
                    this._Stats = ModStatsBinaryWrapper.ModStatsFactory(
                        stream: stream,
                        package: _package,
                        recordTypeConverter: null);
                    return TryGet<int?>.Succeed((int)ModHeader_FieldIndex.Stats);
                }
                case 0x5453464F: // OFST
                {
                    _TypeOffsetsLocation = (ushort)(stream.Position - offset);
                    return TryGet<int?>.Succeed((int)ModHeader_FieldIndex.TypeOffsets);
                }
                case 0x454C4544: // DELE
                {
                    _DeletedLocation = (ushort)(stream.Position - offset);
                    return TryGet<int?>.Succeed((int)ModHeader_FieldIndex.Deleted);
                }
                case 0x4D414E43: // CNAM
                {
                    _AuthorLocation = (ushort)(stream.Position - offset);
                    return TryGet<int?>.Succeed((int)ModHeader_FieldIndex.Author);
                }
                case 0x4D414E53: // SNAM
                {
                    _DescriptionLocation = (ushort)(stream.Position - offset);
                    return TryGet<int?>.Succeed((int)ModHeader_FieldIndex.Description);
                }
                case 0x5453414D: // MAST
                {
                    this.MasterReferences = this.ParseRepeatedTypelessSubrecord<MasterReferenceBinaryWrapper>(
                        stream: stream,
                        recordTypeConverter: null,
                        trigger: ModHeader_Registration.MAST_HEADER,
                        factory:  MasterReferenceBinaryWrapper.MasterReferenceFactory);
                    return TryGet<int?>.Succeed((int)ModHeader_FieldIndex.MasterReferences);
                }
                case 0x4D414E4F: // ONAM
                {
                    var subMeta = _package.Meta.ReadSubRecord(stream);
                    var subLen = subMeta.RecordLength;
                    this.OverriddenForms = BinaryWrapperSetList<IFormIDLinkGetter<ISkyrimMajorRecordGetter>>.FactoryByStartIndex(
                        mem: stream.RemainingMemory.Slice(0, subLen),
                        package: _package,
                        itemLength: 4,
                        getter: (s, p) => new FormIDLink<ISkyrimMajorRecordGetter>(FormKey.Factory(p.MasterReferences, BinaryPrimitives.ReadUInt32LittleEndian(s))));
                    stream.Position += subLen;
                    return TryGet<int?>.Succeed((int)ModHeader_FieldIndex.OverriddenForms);
                }
                case 0x56544E49: // INTV
                {
                    _INTVLocation = (ushort)(stream.Position - offset);
                    return TryGet<int?>.Succeed((int)ModHeader_FieldIndex.INTV);
                }
                case 0x43434E49: // INCC
                {
                    _INCCLocation = (ushort)(stream.Position - offset);
                    return TryGet<int?>.Succeed((int)ModHeader_FieldIndex.INCC);
                }
                default:
                    return TryGet<int?>.Succeed(null);
            }
        }
    }

